import axios from 'axios';

export async function getAll() {
  const characters = await axios.get('http://localhost:3000/characters') 
    .then((response) => response.data)
  console.log(characters)
}

export async function createEmail(character, cartoon) {
  const user = await axios.post('http://localhost:3000/character', {character, cartoon}) 
  console.log(user)
  if(user) {
    return true
  } else {
    return false 
  }
}
